import React, { createElement } from 'react';
import axios from 'axios';

export default class SystemList extends React.Component {
  ish;
  res =[];
  docd;
  componentDidMount() {
    axios.get(`https://new.vyatsu.ru/sveden/common`)
        .then(res => {
            const tp = res.data;
            this.ish = tp;
        })
        this.docd = document.createElement("html");
        this.docd = this.ish;
        
  }
  
  render() {
    return (
      this.docd
    )
  }
}
